import React, { useState,} from 'react';
import './App.css';
function App() { 
  var randomColor = "#"+Math.floor(Math.random()*16777215).toString(16);
  const [maria,setmaria]=useState(0)
  const [ma,setma]=useState(0)
  return(
      <div className='App'> 
      <div className='test' style={{backgroundColor:randomColor}}></div>
       <button onClick={()=>setmaria(maria+1)}>maria</button>
       <button onClick={()=>setma(ma+1)}>ma</button>
      </div>
  )
}

export default App;
